Accounts_CustomFields_Description:
Geçerli bir JSON olmalı; anahtar sözcükler, alan ayarları sözlüğünü içeren alan adlarıdır. Örnek:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Anahtarların bir anahtar sözcük ve çeviriler içeren diller olduğu geçerli bir JSON olmalıdır. Örnek: <br/><code>{
 "en": {
  "Channels": "Rooms"
 }
"pt":{
  "Channels": "Salas"
 }
}</code>
